[{"location":"quickstart/#Installation:","page":"Install and Quick Start","title":"Installation:","text":"","category":"section"},{"location":"quickstart/#As-a-julia-registered-package-(recommended):","page":"Install and Quick Start","title":"As a julia registered package (recommended):","text":"","category":"section"},{"location":"quickstart/","page":"Install and Quick Start","title":"Install and Quick Start","text":"Download the latest release of Julia\nComing soon!: add the Thrase package: from the julia repl:","category":"page"},{"location":"quickstart/","page":"Install and Quick Start","title":"Install and Quick Start","text":"] add Thrase","category":"page"},{"location":"quickstart/","page":"Install and Quick Start","title":"Install and Quick Start","text":"Test the installation:","category":"page"},{"location":"quickstart/","page":"Install and Quick Start","title":"Install and Quick Start","text":"] test Thrase","category":"page"},{"location":"quickstart/#From-source-(in-your-terminal):","page":"Install and Quick Start","title":"From source (in your terminal):","text":"","category":"section"},{"location":"quickstart/","page":"Install and Quick Start","title":"Install and Quick Start","text":"Download the latest release of Julia\nClone the repository","category":"page"},{"location":"quickstart/","page":"Install and Quick Start","title":"Install and Quick Start","text":"git clone https://github.com/Thrase/Thrase.jl.git","category":"page"},{"location":"quickstart/","page":"Install and Quick Start","title":"Install and Quick Start","text":"Activate the project and download and compile dependencies","category":"page"},{"location":"quickstart/","page":"Install and Quick Start","title":"Install and Quick Start","text":"cd Thrase.jl\njulia --project=.\n] activate .","category":"page"},{"location":"quickstart/","page":"Install and Quick Start","title":"Install and Quick Start","text":"Install any dependencies (only necessary the first time)","category":"page"},{"location":"quickstart/","page":"Install and Quick Start","title":"Install and Quick Start","text":"] instantiate","category":"page"},{"location":"quickstart/","page":"Install and Quick Start","title":"Install and Quick Start","text":"Test the installation ","category":"page"},{"location":"quickstart/","page":"Install and Quick Start","title":"Install and Quick Start","text":"include(\"test/runtests.jl\");","category":"page"},{"location":"quickstart/#Getting-Started:","page":"Install and Quick Start","title":"Getting Started:","text":"","category":"section"},{"location":"quickstart/","page":"Install and Quick Start","title":"Install and Quick Start","text":"To run the code for the first SEAS benchmark problem","category":"page"},{"location":"quickstart/","page":"Install and Quick Start","title":"Install and Quick Start","text":"localARGS = [\"examples/bp1-qd.dat\"]\ninclude(\"examples/stripped_qd_driver.jl\");","category":"page"},{"location":"quickstart/","page":"Install and Quick Start","title":"Install and Quick Start","text":"Note that the parameters set in the input file \"examples/bp1-qd.dat\" are slightly modified from the benchmark description to allow for fast simulation on most personal computers. The driver file calls a stripped down version of the code (for training purposes).","category":"page"},{"location":"","page":"Home","title":"Home","text":"CurrentModule = Thrase","category":"page"},{"location":"#Thrase","page":"Home","title":"Thrase","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Documentation for Thrase.","category":"page"},{"location":"#About","page":"Home","title":"About","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Thrase is a GPU-enabled, high-order accurate SBP-SAT finite difference code on unstructured meshes for SEAS (Sequences of Earthquakes and Aseismic Slip) problems written entirely in Julia.  ","category":"page"},{"location":"#Features:","page":"Home","title":"Features:","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"high-order accurate finite difference spatial discretizations featuring provably stability\ndirect and matrix-free iterative solvers for static problems via Julia\nnon-stiff methods for fully-dynamic (wave propagation) problems involving rate-and-state friction\nhigh-order accurate, adaptive time-stepping via Julia\nunstructured hexahedral meshes\nnon-planar boundaries and interfaces ","category":"page"},{"location":"#Dependencies:","page":"Home","title":"Dependencies:","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Thrase is written entirely in Julia","category":"page"},{"location":"#How-to-cite:","page":"Home","title":"How to cite:","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Erickson, B. A., Kozdon, J. E., and Harvey, T. (2022), A non-stiff summation-by-parts finite difference method for the wave equation in second order form: Characteristic boundary conditions and nonlinear interfaces, Journal of Scientific Computing, doi: 10.1007/s10915-022-01961-1. \nKozdon, J. E., Erickson, B. A., and Wilcox, L. C. (2020), Hybridized summation-by-parts finite difference methods, Journal of Scientific Computing, doi: 10.1007/s10915-021-01448-5.\nErickson, B. A. and Dunham, E. M. (2014), An efficient numerical method for earthquake cycles in heterogeneous media: Alternating sub-basin and surface-rupturing events on faults crossing a sedimentary basin, Journal of  Geophysical Research, doi:10.1002/2013JB010614.","category":"page"},{"location":"#License:","page":"Home","title":"License:","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Distributed under the MIT License. See LICENSE.txt for more information.","category":"page"},{"location":"#Contact:","page":"Home","title":"Contact:","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Brittany A. Erickson (bae@uoregon.edu)","category":"page"},{"location":"","page":"Home","title":"Home","text":"","category":"page"},{"location":"","page":"Home","title":"Home","text":"Modules = [Thrase]","category":"page"},{"location":"parameters/#Input-Parameters","page":"Input Parameters","title":"Input Parameters","text":"","category":"section"},{"location":"parameters/","page":"Input Parameters","title":"Input Parameters","text":"In the example input file for benchmark problem 1 (Thrase.jl/examples/bp1-qd.dat) there are multiple parameters that can be updated to change the problem. They are desribed in the table below. ","category":"page"},{"location":"parameters/","page":"Input Parameters","title":"Input Parameters","text":"Sometimes the benchmark description paper contains slightly different names than the input file, we indicate in the description in parantheses if this is the case.","category":"page"},{"location":"parameters/","page":"Input Parameters","title":"Input Parameters","text":"Input File Parameter Units Data Type Description\npth - string path to the directory that stores output data\ngenerate_plots - boolean option to generate example plots\nstride_space - Real <: Number write-out every \"stride_space\" grid points along fault\nstride_time - Real <: Number write-out every \"stride_time\" time steps\nx1 km Real <: Number x-domain is (x1, x2)\nx2 km Real <: Number x-domain is (x1, x2)\nz1 km Real <: Number z-domain is (z1, z2)\nz2 km Real <: Number z-domain is (z1, z2)\nNx - Real <: Number number of grid points in each dimension\nNz - Real <: Number number of grid points in each dimension\nsim_years years Real <: Number how many years to simulate\nVp m/s Real <: Number plate rate\nρ kg/m<sup>3</sup> Real <: Number density\ncs km/s Real <: Number shear wave speed\nσn MPa Real <: Number effective normal stress on fault\nRSamin - Real <: Number rate-and-state parameter (a<sub>0</sub>)\nRSamax - Real <: Number rate-and-state parameter (a<sub>max</sub>)\nRSb - Real <: Number rate-and-state parameter (b<sub>0</sub>)\nRSDc m Real <: Number critical slip distance (D<sub>c</sub>)\nRSf0 m/s Real <: Number reference friction\nRSV0 m/s Real <: Number reference slip rate initial slip rate (V<sub>0</sub>)\nRSVinit m/s Real <: Number initial slip rate (V<sub>init</sub>)\nRSH1 km Real <: Number depth extent of uniform VS region (H)\nRSH2 km Real <: Number width of VS-VS transition zone (h)\nRSWf km Real <: Number width of rate-and-state fault (W<sub>f</sub>)\nSBPp - Real <: Number SBP interior spatial order of accuracy","category":"page"}]
